import React, { useState, useEffect, useCallback } from 'react'
import './App.css'
import { BookmarkPlus, Trash2 } from 'lucide-react'

function App () {
  const [bookmarks, setBookmarks] = useState([])
  const [url, setUrl] = useState('')
  const [title, setTitle] = useState('')

  const saveBookmarks = useCallback((updated) => {
    localStorage.setItem('bookmarks', JSON.stringify(updated))
  }, [])

  useEffect(() => {
    const local = localStorage.getItem('bookmarks')
    if (local) {
      setBookmarks(JSON.parse(local))
    } else {
      fetch('/bookmarks.json')
        .then(res => {
          if (!res.ok) throw new Error('Failed to load bookmarks')
          return res.json()
        })
        .then(data => {
          setBookmarks(data)
          localStorage.setItem('bookmarks', JSON.stringify(data))
        })
        .catch(err => {
          console.error('Error loading bookmarks:', err)
        })
    }
  }, [])

  const handleAdd = (e) => {
    e.preventDefault()
    if (!url || !title) return

    const newBookmark = {
      id: Date.now(),
      title,
      url
    }

    const updated = [newBookmark, ...bookmarks]
    setBookmarks(updated)
    saveBookmarks(updated)
    setUrl('')
    setTitle('')
  }

  const handleDelete = (id) => {
    const updated = bookmarks.filter(b => b.id !== id)
    setBookmarks(updated)
    saveBookmarks(updated)
  }

  return (
    <div className='app'>
      <div className='container'>
        {/* Error Display */}
        {error && (
          <div className='error-message'>
            <p>{error}</p>
            <button onClick={() => setError(null)} className='btn btn-secondary'>
              Dismiss
            </button>
          </div>
        )}

        {/* Header */}
        <div className='header-card'>
          <div className='header-content'>
            <div className='header-title'>
              <Bookmark size={32} />
              <h1>Bookmark Manager</h1>
              <span className='bookmark-count'>({bookmarks.length} bookmarks)</span>
            </div>
            <div className='header-actions'>
              <button
                onClick={() => setShowAddForm(true)}
                className='btn btn-primary'
              >
                <Plus size={20} />
                <span>Add Bookmark</span>
              </button>

              {/* Export Button */}
              <button
                onClick={exportBookmarks}
                className='btn btn-secondary'
                title='Export bookmarks to JSON file'
              >
                <Download size={20} />
                <span>Export</span>
              </button>

              {/* Import Button */}
              <label className='btn btn-secondary' title='Import bookmarks from JSON file'>
                <Upload size={20} />
                <span>Import</span>
                <input
                  type='file'
                  accept='.json'
                  onChange={importBookmarks}
                  style={{ display: 'none' }}
                />
              </label>

              {/* Clear All Button */}
              {bookmarks.length > 0 && (
                <button
                  onClick={clearAllBookmarks}
                  className='btn btn-danger'
                  title='Clear all bookmarks'
                >
                  <RotateCcw size={20} />
                  <span>Clear All</span>
                </button>
              )}
            </div>
          </div>

          {/* Search and Filter */}
          <div className='search-filter-container'>
            <div className='search-box'>
              <Search className='search-icon' size={20} />
              <input
                type='text'
                placeholder='Search bookmarks...'
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className='search-input'
              />
            </div>
            <div className='filter-box'>
              <Tag className='filter-icon' size={20} />
              <select
                value={selectedCategory}
                onChange={(e) => setSelectedCategory(e.target.value)}
                className='filter-select'
              >
                {categories.map(category => (
                  <option key={category} value={category}>{category}</option>
                ))}
              </select>
            </div>
          </div>
        </div>

        {/* Add/Edit Form */}
        {showAddForm && (
          <div className='form-card'>
            <h2>{editingBookmark ? 'Edit Bookmark' : 'Add New Bookmark'}</h2>
            <div className='form-container'>
              <div className='form-row'>
                <div className='form-group'>
                  <label>Title *</label>
                  <input
                    type='text'
                    value={formData.title}
                    onChange={(e) => setFormData({ ...formData, title: e.target.value })}
                    className='form-input'
                    required
                  />
                </div>
                <div className='form-group'>
                  <label>URL *</label>
                  <input
                    type='url'
                    value={formData.url}
                    onChange={(e) => setFormData({ ...formData, url: e.target.value })}
                    className='form-input'
                    required
                  />
                </div>
              </div>
              <div className='form-group'>
                <label>Category</label>
                <input
                  type='text'
                  value={formData.category}
                  onChange={(e) => setFormData({ ...formData, category: e.target.value })}
                  className='form-input'
                  placeholder='e.g., Development, Tools, News'
                />
              </div>
              <div className='form-group'>
                <label>Description</label>
                <textarea
                  value={formData.description}
                  onChange={(e) => setFormData({ ...formData, description: e.target.value })}
                  className='form-textarea'
                  rows='3'
                  placeholder='Brief description of the bookmark'
                />
              </div>
              <div className='form-buttons'>
                <button
                  type='button'
                  onClick={handleSubmit}
                  className='btn btn-primary'
                >
                  {editingBookmark ? 'Update' : 'Add'} Bookmark
                </button>
                <button
                  type='button'
                  onClick={resetForm}
                  className='btn btn-secondary'
                >
                  Cancel
                </button>
              </div>
            </div>
          </div>
        )}

        {/* Bookmarks Grid */}
        <div className='bookmarks-grid'>
          {filteredBookmarks.map(bookmark => (
            <div key={bookmark.id} className='bookmark-card'>
              <div className='bookmark-header'>
                <h3 className='bookmark-title'>{bookmark.title}</h3>
                <div className='bookmark-actions'>
                  <button
                    onClick={() => handleEdit(bookmark)}
                    className='action-btn'
                  >
                    <Edit3 size={16} />
                  </button>
                  <button
                    onClick={() => handleDelete(bookmark.id)}
                    className='action-btn delete-btn'
                  >
                    <Trash2 size={16} />
                  </button>
                </div>
              </div>

              {bookmark.description && (
                <p className='bookmark-description'>
                  {bookmark.description}
                </p>
              )}

              <div className='bookmark-meta'>
                {bookmark.category && (
                  <span className='bookmark-category'>
                    {bookmark.category}
                  </span>
                )}
                <span className='bookmark-date'>
                  {bookmark.dateAdded}
                </span>
              </div>

              <a
                href={bookmark.url}
                target='_blank'
                rel='noopener noreferrer'
                className='bookmark-link'
              >
                <ExternalLink size={16} />
                <span className='bookmark-url'>{bookmark.url}</span>
              </a>
            </div>
          ))}
        </div>

        {filteredBookmarks.length === 0 && !loading && (
          <div className='empty-state'>
            <Bookmark size={64} />
            <h3>No bookmarks found</h3>
            <p>
              {searchTerm || selectedCategory !== 'All'
                ? 'Try adjusting your search or filter criteria'
                : 'Add your first bookmark to get started!'
              }
            </p>
          </div>
        )}
      </div>
    </div>
  )
}

export default App
